import { Button, Col } from 'react-bootstrap';
import {React,useState} from 'react';
import '../App.css';
import ItemCategoria from './ItemCategoria';

export default function BarraCategorias() {

  const [dataItems, setdataItems] = useState([{title:"test",nameCategoria:"teest2",cantidadProducto:10}]);

  

  return (
    <Col lg="8" className=' mt-2 mb-4'>
    
      <div class="nav center-NavBarra-Categorias rounded segundoColor justify-content-center p-2">

      <Button  className=' rounded-pill '>Back</Button>

        {dataItems.map(({title,nameCategoria,cantidadProducto})=><ItemCategoria  title={title}nameCategoria={nameCategoria} cantidadProducto={cantidadProducto}/>)}

      <Button className='rounded-pill'>Next</Button>

      </div>
     
    </Col>
  )
}
